import React from 'react';
import './App.css';
export default function Card(){
    const data=[
        {
     id:1,
     img:'',
     description:'showbido'
        },
        {
      id:2,
      img:'',
      description:'shabisa'
        },
        {
      id:3,
       img:'',
      description:'shazam'
        },
        {
      id:4,
      img:'',
      description:'counterfit'
        },
        {   
            id:5,
            img:'',
            description:'assiah'
        },
        {
            id:6,
            img:'',
            description:'oaho'
        },
    ]
    const items=data.map((item)=>{
        return(<div className='photos'><img src={item.img}/><h4>{item.title}</h4></div>)
    })
    return(
  <section>
    <div></div>
    <div>
    <div className='item-pict'>
           {items} 
        </div>
    </div>
  </section>
    )
}
